import React from 'react';
import './Logo.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Return logo view 
export default function REturnLogo() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => {

 React.useEffect(() => {
  TweenMax.from('.wrp-logo-register img', 1.2, { delay: .8, y: 30, ease: Expo.easeInOut })

 }, []);

 return (
  <div className='wrp-logo-register'>
   <img src={'/img/logo.jpg'} alt={'logo view '} />
  </div>
 )
}
export const ScreenSmall = () => {
 React.useEffect(() => {
  TweenMax.from('.wrp-logo-register-sm img', 1.2, { delay: .8, y: 30, opacity: 0, ease: Expo.easeInOut })

 }, []);

 return (
  <div className='wrp-logo-register-sm'>
   <img src={'/img/logo.jpg'} alt={'logo view '} />
  </div>
 )
}
